import React from "react"
import web from "../src/Images/logo.png";
import {NavLink} from 'react-router-dom';
import Common from './Common';
const Home=()=>
{

    return(
        <>
  <Common  
  name='Welcome to Home Page'
   imgsrc={web} 
    visit='/contact' 
     btname="Contact Now" />
        
        
        </>

    );
};


export default Home;
